export default function isIncluded(tab, item){
    let output = [false, null];
    if(tab !== null && tab.length !== 0){
        for (let i = 0; i<tab.length; i++){
            if(tab[i].id === item.id){
                return [true, tab[i]];
            }
        }
    }
    return output;
}
